import React from 'react'

function Header(param) {
  return (
    <header>
        <div className='container'>
            <h1>{param.text}</h1>
        </div>

    </header>
  )
}

Header.defaultProps ={
    texto: 'Este es el texto por defecto si no recibo argumentos'
}
export default Header
